@philipyoungg If you enjoy building Session, keep at it! I have private projects that I enjoy creating but I know the spaces are too niche or too crowded.  
Why do it then? They’re essential to me. 

I would say aim at other spaces; if you enjoy the space, great but if you don’t, that’s okay.

